import React from 'react'
import Image from '../../images/teambg.jpg'
import{
    TemaContainer,
    ImgBG,
    TeamBG
} from './TeamElements'


const Team = () => {
    return (
        <>
            <TemaContainer>
                <TeamBG>
                    <ImgBG src={Image} type='jpg/png'/>
                </TeamBG>
            </TemaContainer>  
        </>
    )
}

export default Team
